defs.script:

// API externe (svg embed ou inline..)
window.patterntrfpanel = {
	'init' : function() {
		window.patterntrf_init();
	},
	'setTarget' : function(v,p) {
		window.patterntrf_setTarget(v,p);
	},
	'applyOnCopy' : function() {
		return window.patterntrf_applyOnCopy();	
	},
	'applyOnCustomize' : function() {
		return window.patterntrf_applyOnCustomize();	
	}
};

window.parent.patterntrfpanel=window.patterntrfpanel;
